import React from "react";
import styled from "styled-components";


const Home = (props) => {
  
  return (
    <>
      <center><a href="/datatable"><img class="logo" src="../img/lopta.png" alt="lopta"/></a></center>
      <div>
        <h1>Hrvatski nogometni klubovi</h1>
      </div>
    </>
  );
  
};

export default Home;

const MojDiv= styled.div`
`;
